import styled from "styled-components";

import tombstone from "../assets/tombstone.png";

const Confirmation = () => {
  return <Wrapper>
    <div>
      Your flight is confirmed!
      <div>
        <ul>
          <li>Reservation #:</li>
          <li>Flight #:</li>
          <li>Seat #:</li>
          <li>Name #:</li>
          <li>Email #:</li>
        </ul>
      </div>
    </div>
  </Wrapper>;
};

const Wrapper = styled.div``;

export default Confirmation;
